member_login.member_login:
  path: 'admin/people/member-lgoin'
  defaults:
    _title: 'Member Login'
    _controller: '\Drupal\member_login\Controller\Member::list'
  requirements:
    _permission: 'access administration pages'
    _format: 'html'
member_login.api_settings_form:
  path: 'admin/config/member-login/settings'
  defaults:
    _form: '\Drupal\member_login\Form\IpKeySettingsForm'
    _title: 'Set ipdata api key'
  requirements:
    _permission: 'access administration pages'
